import React from 'react';
import './App.css';
import GenerateGarden from "./component/GenerateGarden";

const theme = {
  dark: {
    background: "#555",
    color: "FFF"
  },
  light: {
    background: "#FFF",
    color: "#555"
  }
}

const ThemeContext = React.createContext(theme.dark)

function SearchForm() {
  return <div>
    <ThemedButton>AAAAAA</ThemedButton>
  </div>
}

function Toolbar() {
  return <div>
    <SearchForm />
    <ThemedButton>AAAAAA</ThemedButton>
  </div>
}

function ThemedButton(children) {
  return <ThemeContext.Consumer>
    {value => {
      return <button style={value}>{children}</button>
    }}
  </ThemeContext.Consumer>
}

function App() {
  return (
    <div className="App">
      <h1>My Emoji Garden</h1>
        <Toolbar/>
        <GenerateGarden />
    </div>
  );
}

export default App;
